// -------------------------------------------------------------------------------------------------------------------------------
let vl=0;
function increment(){
    vl++
     let a=document.getElementById('counter')
     a.textContent=vl

}

function decrement(){
    if(vl!=0){
        vl--;
        document.getElementById('counter').innerHTML=vl
    }
}
function reset(){
    vl=0;
    document.getElementById('counter').innerHTML=vl
}
